import React from 'react';

import ButtonSmall from '../../UserInterface/Buttons/Button/ButtonSmall';
import Button from '../../UserInterface/Buttons/Button/Button';


function ConsoleCountRow(props) {

    return (

        <div className={props.classname}>
            <div>
                <Button
                    className='buttonConsoleCountRow'
                    onclick={props.onclick}
                    tabindex='-1'
                    name = '1'
                />
            </div>
            <div>
                Строк на странице: 10
            </div>
            <ButtonSmall
                className={props.classnameButtonConsoleCountPow}
                onclick={props.onclick}
                tabindex='-1'
                icon= "fa fa-list-ol"
            />
            
        </div>

    )
}

export default ConsoleCountRow
